import React from 'react';

const EventModal = ({ isOpen, onClose, event }) => {
  return (
    isOpen && (
      <div className="event-modal">
        <div className="event-modal-content">
          <button className="event-modal-close-button" onClick={onClose}>
            Close
          </button>
          <div className="event-modal-title">{event.title}</div>
          <div className="event-modal-time">{event.time}</div>
          <div className="event-modal-description">{event.description}</div>
        </div>
      </div>
    )
  );
};

export default EventModal;
